import React from "react";
import Sidebar from "../components/Sidebar";
import "../css/reports.scss";

class Reports extends React.Component {
    render() {
        return (
            <section>
                <aside>
                    <Sidebar />
                </aside>
                <main></main>
            </section>
        );
    }
}

export default Reports;
